// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract PlaySudoku {

    uint8[9][9] public currentBoard;
    uint8 public emptyCount;
    mapping(address => bool) public didThePlayerWin;

    constructor() {
        generateBoard();
    }

    function generateBoard() public {
        solveBoard(0, 0);

        emptyCount = 0;
        for (uint8 i = 0; i < 2; i++) {
            uint8 row = uint8(block.timestamp) % 9;
            uint8 col = uint8(uint256(blockhash(block.number - i)) % 9);
            if (currentBoard[row][col] != 0) {
                currentBoard[row][col] = 0;
                emptyCount++;
            }
        }
    }

    function solveBoard(uint8 row, uint8 col) private returns (bool) {
        if (col == 9) {
            col = 0;
            row++;
        }
        if (row == 9) {
            return true;
        }
        if (currentBoard[row][col] != 0) {
            return solveBoard(row, col + 1);
        }
        for (uint8 i = 1; i <= 9; i++) {
            if (isValid(row, col, i)) {
                currentBoard[row][col] = i;
                if (solveBoard(row, col + 1)) {
                    return true;
                }
                currentBoard[row][col] = 0;
            }
        }
        return false;
    }

    function isValid(uint8 row, uint8 col, uint8 num) public view returns (bool) {
        for (uint8 i = 0; i < 9; i++) {
               if (currentBoard[row][i] == num || currentBoard[i][col] == num) {

                return false;
             }
        }
        uint8 boxRow = row - row % 3;
        uint8 boxCol = col - col % 3;
        for (uint8 i = 0; i < 3; i++) {
            for (uint8 j = 0; j < 3; j++) {

                if (currentBoard[boxRow + i][boxCol + j] == num) {
                    return false;
                }
            }
        }
        return true;
    }

function isValidSudoku(uint8 row, uint8 col, uint8 num) public view returns (bool) {
  for (uint8 i = 0; i < 9; i++) {
    if (i != col && currentBoard[row][i] == num || i != row && currentBoard[i][col] == num) {
      return false;
    }
  }
  uint8 boxRow = row - row % 3;
  uint8 boxCol = col - col % 3;
  for (uint8 i = 0; i < 3; i++) {
    for (uint8 j = 0; j < 3; j++) {
      if (boxRow + i != row && boxCol + j != col && currentBoard[boxRow + i][boxCol + j] == num) {
        return false;
      }
    }
  }
  return true;
}




    function verifyWin(uint8[9][9] memory newBoard) public {
        currentBoard = newBoard;
        for (uint8 i = 0; i < 9; i++) {
            for (uint8 j = 0; j < 9; j++) {
                if (!isValidSudoku(i, j, currentBoard[i][j]) || currentBoard[i][j] == 0) {
                     didThePlayerWin[msg.sender] = false;
                } 
            }
        }

        didThePlayerWin[msg.sender] = true;
    }

    function getBoard() public view returns (uint8[9][9] memory) {
        return currentBoard;
    }
}

